const Couter = () =>{
   const [state, setState] = useState(0);

   return(
      <Fragment>
         <h1>State 값 : {state}</h1>
         <button onClick={()=>useState(state+1)}>1씩 증가</button>
      </Fragment>
   );
};

export default Couter;
